import '../App.css'

function Home() {
  return (
    <main className="home">
      <div>
      <h1>AFEWOFNEWS</h1>
      <h4>Welcome to my app!</h4><i> Signup and explore, share and vote news</i>
      <p>by Javier Justo</p>
      </div>
    </main>
  )
}

export default Home;
